STAR_BRONZE_NAME:"HACKER – BRONZOVÁ SLUŽEBNÍ HVĚZDA",BFH_ID_P_HACKER_STAR_GOLD_DESC:e,BFH_ID_P_HACKER_STAR_GOLD_NAME:"HACKER – ZLATÁ SLUŽEBNÍ HVĚZDA",BFH_ID_P_HACKER_STAR_SILVER_DESC:e,BFH_ID_P_HACKER_STAR_SILVER_NAME:"HACKER – STŘÍBRNÁ SLUŽEBNÍ HVĚZDA",BFH_ID_P_IDESC_40MM:"Není zcela jasné, jak se policejní složky k této hračce dostaly. Granátomet vrhá trhavé granáty ráže 40 mm, které jsou účinné proti lehkým obrněným cílům a agentům.",BFH_ID_P_IDESC_AMMO:"Umístitelná bedna s municí. Doplňuje výbušniny a munici všem okolním agentům. Kdokoli v blízkosti nosiče bedny si od něj může doplnit zásoby.",BFH_ID_P_IDESC_ARMORINSERT:"Přídavná výztuha nabízí vrstvu ochrany hrudi před balistickým poškozením, což poskytne uživateli extra čas na reakci.",BFH_ID_P_IDESC_BALLISTIC_SHIELD:"Balistický štít je navržen k blokování střel a poškození z exploze výbušnin. Po absorbování určitého množství poškození se štít zničí. Štít lze použít k úderu nepřítele.",BFH_ID_P_IDESC_BEACON:"Satelitní telefon poskytuje nový výsadkový bod pro vás nebo členy vašeho družstva.",BFH_ID_P_IDESC_C4:"Plastická trhavina, která se přichytává k jakémukoliv povrchu. Díky dálkovému detonátoru lze použít na přípravu pastí a léček.",BFH_ID_P_IDESC_DECOY:"Zdroj klamných zvuků, který vytváří na nepřátelském radaru falešné ukazatele hráčů a napodobuje zvuky střelby.",BFH_ID_P_IDESC_DEFIB:"AED (Autom. externí defibrilátor) je přenosné elektronické zařízení, které umožňuje vzkřísit padlého spoluhráče. Pokud dojde k přípravě AED, je hráč vzkříšen s vyšší hodnotou zdraví. Při plném nabití jej lze použit k zabití nepřítele.",BFH_ID_P_IDESC_DEPLOYABLE_CAMERA:"Kamera, která v širokém kuželu před sebou odhaluje a oznamuje nepřátelský pohyb. Nepodceňujte důležitost výzvědných aktivit!",BFH_ID_P_IDESC_DINO_MASK:"S touto gumovou dinosauří maskou to dáte zločincům pěkně sežrat. Blahopřejeme, patříte mezi elitu!",BFH_ID_P_IDESC_FLASHBANG:"Ruční granát M84 s oslepujícím účinkem. Lze použít k zmatení nepřátel a odvedení jejich pozornosti.",BFH_ID_P_IDESC_GAS_GRENADE:"Granát s časovým zapalovačem, který po výbuchu vytváří oblak slzného plynu. Osoby zasažené plynem trpí rozmazaným viděním, kvůli čemuž nemohou přesně mířit, navíc jsou obecně náchylnější k případným zraněním.",BFH_ID_P_IDESC_GAS_MASK:"Plynová maska chrání nejen před účinky plynového granátu, ale také před nežádoucími vlivy některých ekologických hrozeb.",BFH_ID_P_IDESC_GRAPPLEHOOK:"Lezecký hák lze vystřelit na rovnou římsu, čímž dojde k natažení lana, po kterém můžete šplhat. Lana lze přeseknout nebo zničit výstřelem.",BFH_ID_P_IDESC_INCENDIARY_DEVICE:"Ručně vrhaný zápalný granát po výbuchu vytváří ohnivou plochu, což lze využít k dočasné blokaci cest nebo vyhnání nepřátel z úkrytu.",BFH_ID_P_IDESC_LASER_TRIPMINE:"Výbušná mina, které exploduje při porušení laserového paprsku. Lze ji umístit na jakýkoli povrch v dosahu ruky. Agenti, kteří si jí všimnou včas, ji mohou zneškodnit.",BFH_ID_P_IDESC_M18:"Ruční granát s časovým zapalovačem vypouštějící po výbuchu kouřovou clonu. Kouř zabraňuje v označování cílů.",BFH_ID_P_IDESC_M67:"Tříštivé granáty se středním poloměrem výbuchu způsobují výrazné škody pěchotě i vozidlům.",BFH_ID_P_IDESC_M79:"Tento granátomet nebyl pravděpodobně získán zákonnou cestou. Vrhá trhavé granáty ráže 40 mm účinné k eliminaci lehkých obrněných cílů a agentů.",BFH_ID_P_IDESC_MEDKIT:"Umístitelná lékárnička. Automaticky obnovuje zdraví agentů v bezprostřední blízkosti i během boje. Kdokoli ze spoluhráčů, kdo se nachází poblíž člověka s lékárničkou, se od něj může nechat vyléčit.",BFH_ID_P_IDESC_MOLOTOV:"Molotovův koktejl, rozbitná skleněná láhev obsahující hořlavou látku jako benzín, je improvizovanou zápalnou zbraní. Používá se spíše k zamezení přístupu protivníkům než okamžitému zničení cílů.",BFH_ID_P_IDESC_NOGADGET1:vn,BFH_ID_P_IDESC_NOGADGET2:vn,BFH_ID_P_IDESC_REPAIR:"Svařovací hořák určený k opravám spojeneckých vozidel a poškozování nepřátelské techniky i agentů.",BFH_ID_P_IDESC_REVIVE:"Adrenalinová injekce, která má až nepříjemně dlouhou jehlu. Umožňuje vzkřísit padlého spoluhráče. Pokud dojde k přípravě adrenalinové injekce, je hráč vzkříšen s vyšší hodnotou zdraví. Po přípravě ji lze použit i k eliminaci nepřítele.",BFH_ID_P_IDESC_SABOTAGE:"Sabotážní bomba, kterou lze nastražit na vozidla, objekty a interaktivní body. Exploduje při použití nic netušícím nepřítelem – hledejte blikající světýlko. Může být zneškodněna opravnou sadou, výstřelem nebo výbuchem.",BFH_ID_P_IDESC_STEALTHTRAINING:"Agenti s výcvikem neslyšného pohybu se umí tiše přemisťovat. Vyznačují se sníženou hlučností chůze a tišším prováděním akcí, jako je například otvírání dveří.",BFH_ID_P_IDESC_STUNTDRIVER:"Trénovaný řidič vybaví jakékoli pozemní vozidlo oxidem dusným, díky kterému se dokáže rychle dostat z nebezpečí. Trénovaní řidiči navíc utrpí menší zranění při střetu s jinými vozidly nebo překážkami na silnici.",BFH_ID_P_IDESC_SURVIVALIST:"Dostanete příležitost k zotavení ze smrti přejetím nebo výbušninami. Nevztahuje se na úmrtí způsobená střelami, ohněm, plynem, v boji zblízka, omráčením nebo pády.",BFH_ID_P_IDESC_TASER_GUN:"T62 CEW slouží k neletálnímu zneškodnění protivníka na krátkou vzdálenost. Vyslechnutím omráčeného nepřítele zjistíte, kde se poblíž nachází jeho spoluhráči (pouze v režimu více hráčů).",BFH_ID_P_IDESC_TRACKING_DART:"Vystřelte a přichytněte stopovací šipku na nepřátelské hráče a vozidla, čímž je označíte na mapě i minimapě. Umožníte tak hráčům s raketomety zaměřit zvolený cíl.",BFH_ID_P_IDESC_WOLF_MASK:"S touto gumovou vlčí maskou se budete cítit jako vůdce zločinecké smečky. Blahopřejeme, patříte mezi elitu!",BFH_ID_P_IDESC_ZIPLINE:"Pomocí slaňovací kladky spojíte lanem dva body. Chcete-li se rychle přepravit na níže položená místa, stačí v kterémkoli místě naskočit. Přetnutím lana nebo zničením podpěr zabráníte nepřátelům ve využívání tohoto způsobu přemístění.",BFH_ID_P_INAME_40MM:"M320 He",BFH_ID_P_INAME_ACB90:"Acb-90",BFH_ID_P_INAME_AMMO:"Bedna S Municí",BFH_ID_P